return items.map(item => {
  // ✅ PRESERVE the interviewType that was sent from frontend
  // The issue is likely here - make sure we don't override the interviewType
  const interviewType = item.json.interviewType || 'skill'; // Default to 'skill' only if not provided

  // DEBUG: Add these logs to see what's happening
  console.log('=== DEBUG PROCESS INTERVIEW TYPE NODE ===');
  console.log('Raw item.json:', JSON.stringify(item.json, null, 2));
  console.log('Original interviewType from frontend:', item.json.interviewType);
  console.log('Final interviewType after processing:', interviewType);

  // ✅ SET THE INTERVIEW TYPE CORRECTLY - don't override if already set
  item.json.interviewType = interviewType;

  if (interviewType === 'resume') {
    // ✅ FOR RESUME INTERVIEWS: Clear skill/level and preserve resume data
    item.json.skill = null;
    item.json.level = null;
    item.json.skillContext = '';
    item.json.resumeProcessed = true;

    // ✅ ENSURE resume data is preserved
    console.log('Resume interview - preserving resume data:');
    console.log('resumeContent length:', item.json.resumeContent ? item.json.resumeContent.length : 0);
    console.log('resumeFileName:', item.json.resumeFileName);
    console.log('jobDescription length:', item.json.jobDescription ? item.json.jobDescription.length : 0);

    // Make sure resume data is not null/undefined
    item.json.resumeContent = item.json.resumeContent || '';
    item.json.resumeFileName = item.json.resumeFileName || '';
    item.json.jobDescription = item.json.jobDescription || '';

  } else {
    // ✅ FOR SKILL INTERVIEWS: Clear resume data and preserve skill/level
    item.json.resumeContent = null;
    item.json.resumeFileName = null;
    item.json.jobDescription = null;
    item.json.resumeProcessed = false;

    // Create skill context based on level
    const level = item.json.level?.toLowerCase() || '';
    const skill = item.json.skill || 'Unknown Skill';

    let skillContext = '';
    if (level === 'beginner') {
      skillContext = `Basic concepts, syntax fundamentals, simple problem-solving`;
    } else if (level === 'intermediate') {
      skillContext = `Design patterns, debugging, code optimization, frameworks`;
    } else if (level === 'advanced') {
      skillContext = `System architecture, performance tuning, advanced patterns, leadership`;
    }

    item.json.skillContext = skillContext;

    console.log('Skill interview - preserving skill data:');
    console.log('skill:', item.json.skill);
    console.log('level:', item.json.level);
  }

  // Parse conversationHistory if it's a string
  if (typeof item.json.conversationHistory === 'string') {
    try {
      item.json.conversationHistory = JSON.parse(item.json.conversationHistory);
    } catch (e) {
      item.json.conversationHistory = [];
    }
  }

  // Defaults
  item.json.userMessage = item.json.userMessage || "Starting interview";
  item.json.step = item.json.step || "follow_up";
  item.json.questionIndex = item.json.questionIndex || 1;

  console.log('=== FINAL PROCESSED DATA ===');
  console.log('interviewType:', item.json.interviewType);
  console.log('skill:', item.json.skill);
  console.log('level:', item.json.level);
  console.log('resumeContent length:', item.json.resumeContent?.length);
  console.log('resumeFileName:', item.json.resumeFileName);

  return item;
});
